import { BrowserRouter, Route, Routes} from 'react-router-dom';
function App() {
  return (
    // <div>
    <>
      {/* <BrowserRouter> */}
        <Routes>
          <Route exact path="/" component={<Login />} />
          <Route exact path="/profile" component={<Profile />} />
        </Routes>
      {/* </BrowserRouter> */}
    {/* </div> */}
    </>
  );
}

export default App;
